  `is_register` smallint(6) DEFAULT NULL COMMENT '是否注册（0：成功；1：车辆已被注册；2：数据库中无该车辆；）',
  `remark` varchar(50) DEFAULT NULL,
  `auth_code` varchar(45) DEFAULT NULL COMMENT '鉴权码',
  `flag` smallint(6) NOT NULL DEFAULT '1',
  `create_data_time` datetime DEFAULT NULL,
  `create_data_username` varchar(45) DEFAULT NULL,
  `update_data_time` datetime DEFAULT NULL,
  `update_data_username` varchar(45) DEFAULT NULL,
  `channel_id` varchar(30) DEFAULT NULL COMMENT '通道编码',
  `functional_type` varchar(50) NOT NULL DEFAULT '1' COMMENT '1:简易型车机；2：行车记录仪； 3：对讲设备；4：手咪设备',
  `procurement_time` datetime DEFAULT NULL COMMENT '采购时间',
  `audio_code` smallint(6) DEFAULT NULL COMMENT '音频编码方式：0:保留；1：G.721;2:G722;3：G.723;4:G.728;8:G.726;19:AAC;26:ADPCMA;',
  `video_code` smallint(6) DEFAULT NULL COMMENT '视频编码方式：98：H.264；99：H.265',
  `audio_channel` smallint(6) DEFAULT NULL COMMENT '音频声道数',
  `audio_sampling` smallint(6) DEFAULT NULL COMMENT '音频采样率：0:8kHz; 1:22.05kHz; 2:44.1kHz; 3:48kHz;',
  `audio_sampling_bit` smallint(6) DEFAULT NULL COMMENT '音频采样位数：0:8位；1:16位；2:32位；',
