  KEY `idx_create_time` (`create_data_time`),
  KEY `device_number_index` (`flag`,`device_number`,`device_type`,`functional_type`),
  KEY `idx_device_number` (`device_number`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

