DROP TABLE IF EXISTS `zw_m_risk_alarm`;

CREATE TABLE `zw_m_risk_alarm` (
  `id` varchar(64) NOT NULL COMMENT '风险-报警表',
  `event_number` varchar(20) DEFAULT NULL COMMENT '报警编号',
  `event_time` datetime DEFAULT NULL COMMENT '报警时间',
  `event_id` varchar(64) DEFAULT NULL COMMENT '事件功能id',
  `risk_id` varchar(64) DEFAULT NULL COMMENT '风险id',
  `media_id` varchar(64) DEFAULT NULL COMMENT '多媒体id,逗号隔开',
  `warn_id` int(11) DEFAULT NULL COMMENT '报警id',
  `sensor_id` int(11) DEFAULT NULL COMMENT '预警类型：64,65',
  `status` int(11) DEFAULT NULL COMMENT '报警状态：1：开始报警；2：结束报警；16：事件标识',
  `type` int(11) DEFAULT NULL COMMENT '报警类型',
  `level` int(11) DEFAULT NULL COMMENT '报警级别：1：一级报警；2：二级报警',
  `road_markings` int(11) DEFAULT NULL COMMENT '道路标识类型:1:限速标志；2：限高标志；3：限重标志：4—31：用户自定义',
  `road_markings_data` int(11) DEFAULT NULL COMMENT '道路标识识别数据',
  `fatigue_level` int(11) DEFAULT NULL COMMENT '疲劳等级',
  `reserve_value` int(11) DEFAULT NULL COMMENT '驾驶限速值',
  `front_vehicle_speed` double DEFAULT NULL COMMENT '前车车速',
  `front_vehicle_distance` double DEFAULT NULL COMMENT '前车/行人距离',
  `deviation_type` int(11) DEFAULT NULL COMMENT '偏离类型：1：左侧偏离；2：右侧偏离',
  `speed` double DEFAULT NULL COMMENT '车速',
  `altitude` int(11) DEFAULT NULL COMMENT '高程 海拔高度，单位为米（m）',
  `latitude` double DEFAULT NULL COMMENT '纬度，已纠偏',
  `longitude` double DEFAULT NULL COMMENT '经度，已纠偏',
  `warm_time` varchar(45) DEFAULT NULL COMMENT '报警时间',
  `vehicle_status` int(11) DEFAULT NULL COMMENT '车辆状态',
  `keep` int(11) DEFAULT NULL COMMENT '预留值',
  `media_total` int(11) DEFAULT NULL COMMENT '报警附加多媒体信息列表总数',
  `flag` smallint(6) DEFAULT '1',
  `create_data_time` datetime DEFAULT NULL,
  `create_data_username` varchar(64) DEFAULT NULL,
  `update_data_time` datetime DEFAULT NULL,
  `update_data_username` varchar(64) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `IDX_RISK_ID` (`risk_id`,`flag`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

