  `wakeup_close2` varchar(45) DEFAULT NULL COMMENT '时间段2关闭时间HHMM，取值时间00:00-23:59',
  `wakeup_time3` varchar(45) DEFAULT NULL COMMENT '时间段3唤醒时间HHMM，取值时间00:00-23:59',
  `wakeup_close3` varchar(45) DEFAULT NULL COMMENT '时间段3关闭时间HHMM，取值时间00:00-23:59',
  `wakeup_time4` varchar(45) DEFAULT NULL COMMENT '时间段4唤醒时间HHMM，取值时间00:00-23:59',
  `wakeup_close4` varchar(45) DEFAULT NULL COMMENT '时间段4关闭时间HHMM，取值时间00:00-23:59',
  `flag` smallint(6) DEFAULT '1',
