  `speed` varchar(10) DEFAULT NULL COMMENT '速度',
  `speed_limit` varchar(10) DEFAULT NULL COMMENT '限速',
  `longtitude` varchar(20) DEFAULT NULL COMMENT '高德-经度',
  `latitude` varchar(20) DEFAULT NULL COMMENT '高德-维度',
  `spot_check_content` smallint(6) DEFAULT NULL COMMENT '抽查内容 0:定位信息; 1:历史轨迹; 2:查看视频; 3:违章处理;',
