CREATE TABLE `zw_m_device_channel_setting` (
  `id` varchar(64) NOT NULL COMMENT '主键id',
  `physics_channel` int(6) DEFAULT NULL COMMENT '物理逻辑通道号',
  `logic_channel` int(6) DEFAULT NULL COMMENT '逻辑通道号',
  `channel_type` int(6) DEFAULT NULL COMMENT '通道类型: 0:音视频;1:音频;2:视频',
  `connection_flag` int(6) DEFAULT NULL COMMENT '是否连接云台；通道类型为0和2时，此字段有效；0:否;1:是',
  `sort` int(6) DEFAULT NULL COMMENT '排序',
  `stream_type` smallint(6) DEFAULT NULL COMMENT '码流类型 0：主码流 1：子码流',
  `flag` smallint(6) DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='终端型号视频参数设置';


-- 终端型号
CREATE TABLE `zw_m_terminal_type` (
  `id` varchar(64) NOT NULL COMMENT '主键id',
  `terminal_manufacturer` varchar(10) DEFAULT NULL COMMENT '终端厂商',
  `terminal_type` varchar(30) DEFAULT NULL COMMENT '终端型号',
  `support_photo_flag` smallint(6) DEFAULT NULL COMMENT '是否支持拍照 0:否; 1:是;',
  `cameras_number` smallint(6) DEFAULT NULL COMMENT '摄像头个数(1-5)',
  `support_driving_recorder_flag` smallint(6) DEFAULT NULL COMMENT '是否支持行驶记录仪 0:否; 1:是;',
  `support_monitoring_flag` smallint(6) DEFAULT NULL COMMENT '是否支持监听 0:否; 1:是;',
  `support_video_flag` smallint(6) DEFAULT NULL COMMENT '是否支持视频 0:否; 1:是;',
  `audio_format` smallint(6) DEFAULT NULL COMMENT '是否支持视频选择(是)该字段才有效; 音频格式 0:ADPCMA; 1:G726-8K; 2:G726-16K; 3:G726-24K; 4:G726-32K; 5:G726-40K;',
  `channel_number` smallint(6) DEFAULT NULL COMMENT '是否支持视频选择(是)该字段才有效; 通道号个数 1-13',
  `device_channel_id` varchar(1500) DEFAULT NULL COMMENT '是否支持视频选择(是)该字段才有效; 设备通道号参数,逗号分隔;',
  `flag` smallint(6) DEFAULT '1',
  `create_data_time` datetime DEFAULT NULL,
  `create_data_username` varchar(45) DEFAULT NULL,
  `update_data_time` datetime DEFAULT NULL,
  `update_data_username` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='终端型号';


