  `id` varchar(64) NOT NULL,
  `title` varchar(100) DEFAULT NULL COMMENT '页面显示名称',
  `name` varchar(100) DEFAULT NULL COMMENT '字段ID',
  `mark` varchar(100) DEFAULT NULL COMMENT '标识',
  `status` smallint(6) DEFAULT '0' COMMENT '列信息: 0：默认列;  1:非默认列 ; 9: 固定列',
  `sort` smallint(6) DEFAULT NULL COMMENT '默认排序',
  `column_module` varchar(50) DEFAULT NULL COMMENT '所属模块: 如实时监控中的信息列表、报警查询、主动安全、OBD数据、日志记录是同时设置列数据，对应这种多模块，用module来进行区分',
  PRIMARY KEY (`id`),
  KEY `MARK_INDEX` (`mark`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='初始列';





CREATE TABLE `zw_c_custom_column_config` (
  `id` varchar(64) NOT NULL,
  `column_id` varchar(64) NOT NULL COMMENT '初始化列ID',
  `user_id` varchar(64) NOT NULL COMMENT '用户ID',
  `sort` int(6) NOT NULL COMMENT '字段排序',
  `is_fix` smallint(6) NOT NULL DEFAULT '0' COMMENT '是否固定列: 0::不固定, 1:固定',
  `flag` smallint(6) DEFAULT '1',
  `create_data_time` datetime DEFAULT NULL,
  `create_data_username` varchar(45) DEFAULT NULL,
  `update_data_time` datetime DEFAULT NULL,
  `update_data_username` varchar(45) DEFAULT NULL,
  `mark` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `UK_QUERY_INDEX` (`user_id`,`column_id`,`flag`) USING BTREE COMMENT '列ID+用户ID,确定唯一性'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户个性化列';
