-- 主动安全默认参数设置

DROP TABLE IF EXISTS `zw_m_adas_alarm_param_setting`;
CREATE TABLE `zw_m_adas_alarm_param_setting` (
  `id` varchar(255) NOT NULL COMMENT '表id',
  `vehicle_id` varchar(255) NOT NULL COMMENT '车辆id',
  `risk_function_id` int(11) NOT NULL COMMENT '风险时间(function_id)',
  `alarm_enable` tinyint(10) DEFAULT NULL COMMENT '报警开关',
  `gravity_acceleration_threshold` varchar(255) DEFAULT NULL COMMENT '重力加速度阈值',
  `time_threshold` int(11) DEFAULT NULL COMMENT '时间阈值',
  `engine_threshold` varchar(255) DEFAULT NULL COMMENT '发动机转速阈值',
  `speed_threshold` varchar(255) DEFAULT NULL COMMENT '速度阈值',
  `one_level_alarm_enable` tinyint(10) DEFAULT NULL COMMENT '一级报警使能',
  `two_level_alarm_enable` tinyint(10) DEFAULT NULL COMMENT '二级报警使能',
  `video_recording_time` int(11) DEFAULT NULL COMMENT '录制时间',
  `photograph_number` int(11) DEFAULT NULL COMMENT '拍照张数',
  `photograph_time` int(11) DEFAULT NULL COMMENT '拍照间隔',
  `time_distance_threshold` int(11) DEFAULT NULL COMMENT '时距阈值',
  `time_slot_threshold` int(10) DEFAULT NULL COMMENT '时间段阈值/时间间隔',
  `alarm_level_speed_threshold` int(11) DEFAULT NULL COMMENT '报警分级速度阈值',
  `frequency_threshold` tinyint(10) DEFAULT NULL COMMENT '次数阈值',
  `touch_status` tinyint(10) DEFAULT NULL COMMENT '触发状态0:不开启,1:定时拍照,2:定距拍照,3:插卡触发',
  `road_sign_recognition` tinyint(10) DEFAULT NULL COMMENT '道路标识识别使能',
  `param_type` tinyint(10) DEFAULT NULL COMMENT '标签页(前向,驾驶,激烈)',
  `flag` tinyint(10) DEFAULT NULL COMMENT '默认为 1 0:表示删除',
  `road_sign_enable` tinyint(10) DEFAULT NULL COMMENT '道路标识超限报警使能',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `vehicleId` (`vehicle_id`,`param_type`,`flag`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='川标/冀标 报警参数设置表';

