DROP TABLE IF EXISTS `zw_m_adas_common_param_setting`;
CREATE TABLE `zw_m_adas_common_param_setting` (
  `id` varchar(255) NOT NULL COMMENT '表id',
  `vehicle_id` varchar(255) NOT NULL COMMENT '车辆id',
  `camera_resolution` varchar(32) DEFAULT NULL COMMENT '拍照分辨率',
  `video_resolution` varchar(32) DEFAULT NULL COMMENT '视频分辨率',
  `alarm_volume` varchar(32) DEFAULT NULL COMMENT '提示音量',
  `touch_status` varchar(255) DEFAULT NULL COMMENT '触发状态( 0:不开启,1:定时拍照,2:定距拍照,3:插卡触发',
  `photograph_number` int(11) DEFAULT NULL COMMENT '拍照张数',
  `photograph_time` int(11) DEFAULT NULL COMMENT '拍照间隔',
  `timing_photo_interval` varchar(255) DEFAULT NULL COMMENT '定时拍照时间间隔',
  `distance_photo_interval` varchar(255) DEFAULT NULL COMMENT '定距拍照时间间隔',
  `flag` tinyint(10) DEFAULT NULL COMMENT '默认为 1 0:表示删除',
  `speed_limit` int(11) DEFAULT NULL COMMENT '速度阈值',
  `protocol_type` int(11) NOT NULL COMMENT '协议类型',
  `param_type` tinyint(10) NOT NULL COMMENT '报警指令类型 (页签 64 65 70等)',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `vehicleId` (`vehicle_id`,`protocol_type`,`param_type`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='川/冀标 通用参数设置表';

