  `flag` tinyint(4) NOT NULL,
   PRIMARY KEY (`id`),
  KEY `cargo_index` (`time`,`group_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `zw_m_adas_calculate_factor`;
CREATE TABLE `zw_m_adas_calculate_factor` (
  `id` varchar(64) NOT NULL COMMENT '主动安全报警因素表',
  `risk_type` tinyint(4) DEFAULT NULL COMMENT '风险类型',
  `risk_name` varchar(255) DEFAULT NULL COMMENT '风险类型',
  `interval_time` int(11) DEFAULT NULL COMMENT '间隔时间',
  `event_type` int(11) DEFAULT NULL COMMENT '报警事件类型',
  `event_name` varchar(255) DEFAULT NULL COMMENT '报警事件名称',
  `event_common_name` varchar(255) DEFAULT NULL COMMENT '报警事件统称',
  `protocol_type` int(11) DEFAULT NULL COMMENT '协议类型',
  `one_level` tinyint(4) DEFAULT NULL COMMENT '一级等级初始值30km/h≤一级<50km/h',
  `two_level` tinyint(4) DEFAULT NULL COMMENT '二级等级初始值50km/h≤二级',
  `one_speed_factor` float DEFAULT NULL COMMENT '速度等级系数30km/h≤1级<50km/h',
  `two_speed_factor` float DEFAULT NULL COMMENT '速度等级系数50km/h≤2级＜70km/h',
  `three_speed_factor` float DEFAULT NULL COMMENT '速度等级系数3级≥70km/h',
  `one_speed` float DEFAULT NULL COMMENT '一级速度等级速度30km/h',
  `two_speed` float DEFAULT NULL COMMENT '二级速度等级速度50km/h',
  `three_speed` float DEFAULT NULL COMMENT '三级速度等级速度70km/h',
  `flag` tinyint(4) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `zw_m_cargo_month_report`;
CREATE TABLE `zw_m_cargo_month_report` (
  `group_id` varchar(50) NOT NULL COMMENT '组织id',
  `group_name` varchar(100) NOT NULL COMMENT '组织名字',
  `time` int(6) NOT NULL COMMENT '时间',
  `vehicle_total` int(10) DEFAULT NULL COMMENT '车辆总数',
  `add_number` int(10) DEFAULT NULL COMMENT '新增车辆数',
  `delete_number` int(10) DEFAULT NULL COMMENT '删除车辆数',
  `online_rate` float DEFAULT NULL COMMENT '车辆上线率',
  `online_number` int(10) DEFAULT NULL COMMENT '车辆上线数',
  `nerver_online_number` int(10) DEFAULT NULL COMMENT '当月从未上线车辆数',
  `speed_number` int(10) DEFAULT NULL COMMENT '当月超速违章车辆数',
  `speed_rate` float DEFAULT NULL COMMENT '当月车辆超速违章率',
  `tired_number` int(10) DEFAULT NULL COMMENT '当月疲劳违章车辆数',
  `tired_rate` float DEFAULT NULL COMMENT '当月车辆疲劳违章率',
  `flag` tinyint(4) NOT NULL,
  PRIMARY KEY (`group_id`,`time`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='山东报表 月报表数据';

DROP TABLE IF EXISTS `zw_m_adas_hot_map`;
CREATE TABLE `zw_m_adas_hot_map` (
  `time` int(11) NOT NULL COMMENT '年月日、年、月，2019，20190101，201901',
  `content` mediumtext COMMENT '热力图一组数据',
  `flag` tinyint(4) DEFAULT NULL,
  PRIMARY KEY (`time`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


