  `create_data_username` varchar(30) DEFAULT NULL,
  `create_data_time` datetime DEFAULT NULL,
  `update_data_time` datetime DEFAULT NULL,
  `update_data_username` varchar(30) DEFAULT NULL,
  `flag` tinyint(6) NOT NULL DEFAULT '1',
