  `group_name` varchar(64) DEFAULT NULL COMMENT '组织名字',
  `category` varchar(64) DEFAULT NULL COMMENT '配置的类型',
  `name` varchar(64) DEFAULT NULL COMMENT '配置的名字',
  `type` varchar(6) DEFAULT NULL COMMENT '监控对象类型（0车，1人，2物）',
  `app_version` int(11) DEFAULT '20102' COMMENT '该配置对应的app版本号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

