#主动安全平台参数设置表
CREATE TABLE `zw_m_adas_platform_param_setting` (
  `vehicle_id` varchar(64) NOT NULL,
  `param_type` tinyint(4) DEFAULT NULL COMMENT '标签 0:平台参数定义设置',
  `event_code` varchar(60) NOT NULL COMMENT '事件编码',
  `one_level_remind` tinyint(4) DEFAULT NULL COMMENT '一级报警提醒方式 0无,1闪烁,2提示音,3闪烁加提示音,4弹窗提醒,5短信提醒',
  `two_level_remind` tinyint(4) DEFAULT NULL COMMENT '一级报警提醒方式 0无,1闪烁,2提示音,3闪烁加提示音,4弹窗提醒,5短信提醒',
  `distance_threshold` int(11) DEFAULT NULL COMMENT '距离阈值',
  `distance_remind` tinyint(4) DEFAULT NULL COMMENT '距离提醒方式  0无,1闪烁,2提示音,3闪烁加提示音,4弹窗提醒,5短信提醒',
  `distance_num` int(11) DEFAULT NULL COMMENT '距离提醒数量',
  `time_num` int(11) DEFAULT NULL COMMENT '时间提醒数量',
  `time_remind` tinyint(4) DEFAULT NULL COMMENT '时间提醒方式  0无,1闪烁,2提示音,3闪烁加提示音,4弹窗提醒,5短信提醒',
  `time_threshold` int(11) DEFAULT NULL COMMENT '时间阈值',
  `one_level_deal_time_interval` int(11) DEFAULT NULL COMMENT '一级报警处理间隔时间',
  `two_level_deal_time_interval` int(11) DEFAULT NULL COMMENT '二级报警处理间隔时间',
  `push_switch` tinyint(4) DEFAULT NULL COMMENT '推送开发 1:开，0：关',
  PRIMARY KEY (`vehicle_id`,`event_code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

