#监控对象评分
CREATE TABLE `zw_m_monitor_score_month_report` (
  `vehicle_id` varchar(64) NOT NULL COMMENT '车辆id',
  `time` int(11) NOT NULL COMMENT '时间 格式201910',
  `group_id` varchar(64) DEFAULT NULL COMMENT '所属企业id',
  `travel_mile` double DEFAULT NULL COMMENT '行驶里程',
  `travel_num` int(11) DEFAULT NULL COMMENT '行驶次数',
  `travel_time` double(11,0) DEFAULT NULL COMMENT '行驶时长',
  `average_travel_time` varchar(36) DEFAULT NULL COMMENT '平均行驶时长',
  `travel_speed` double NOT NULL COMMENT '平均行驶速度',
  `alarm_total` int(11) DEFAULT NULL COMMENT '报警数',
  `alarm_ring_ratio` varchar(36) DEFAULT NULL COMMENT '报警数环比',
  `score` float DEFAULT NULL COMMENT '综合得分',
  `score_ring_ratio` varchar(36) DEFAULT NULL COMMENT '得分环比',
  `hundreds_alarm_total` double(11,0) DEFAULT NULL COMMENT '百公里报警数',
  `hundreds_alarm_ring_ratio` varchar(36) DEFAULT NULL COMMENT '百公里报警数环比',
  `event_infos` mediumtext COMMENT '风险事件json字符串',
  PRIMARY KEY (`vehicle_id`,`time`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

