#司机评分基础表
CREATE TABLE `zw_m_group_driver_base` (
  `group_id` varchar(255) NOT NULL COMMENT '企业id',
  `time` int(11) NOT NULL COMMENT '（时间）',
  `card_number_name` varchar(255) NOT NULL COMMENT '从业资格证号_司机名称',
  `travel_mile` double DEFAULT '0' COMMENT '行驶里程',
  `travel_times` int(11) DEFAULT '0' COMMENT '行驶次数',
  `travel_time` bigint(11) DEFAULT '0' COMMENT '行驶时长',
  `risk_total` int(11) DEFAULT '0' COMMENT '风险个数',
  `risk_level_value` int(11) DEFAULT '0' COMMENT '风险等级值',
  `event_total` int(11) DEFAULT '0' COMMENT '事件总数',
  `vehicle_crash` int(11) DEFAULT '0' COMMENT '前车碰撞',
  `left_offset` int(11) DEFAULT '0' COMMENT '(风险事件车道左偏移)',
  `right_offset` int(11) DEFAULT '0' COMMENT '(风险事件车道右偏移)',
  `distance` int(11) DEFAULT '0' COMMENT '(风险事件车距过近)',
  `pedestrian_collisions` int(11) DEFAULT '0' COMMENT '(风险事件行人碰撞)',
  `change_lanes` int(11) DEFAULT '0' COMMENT '(风险事件频繁变道)',
  `obstacles` int(11) DEFAULT '0' COMMENT '(风险事件障碍物)',
  `accelerate` int(11) DEFAULT '0' COMMENT '(风险事件急加速)',
  `timeout_driving` int(11) DEFAULT '0' COMMENT '超时驾驶',
  `slow_down` int(11) DEFAULT '0' COMMENT '(风险事件急减速)',
  `turn` int(11) DEFAULT '0' COMMENT '(风险事件急转弯)',
  `road_mark_transfinite` int(11) DEFAULT '0' COMMENT '道路标识超限',
  `phone` int(11) DEFAULT '0' COMMENT '(风险时间接打电话)',
  `smoke` int(11) DEFAULT '0' COMMENT '(风险事件抽烟)',
  `eye_close` int(11) DEFAULT '0' COMMENT '(风险事件闭眼)',
  `yawning` int(11) DEFAULT '0' COMMENT '(风险事件打哈欠)',
  `abnormal_posture` int(11) DEFAULT '0' COMMENT '(风险事件姿态异常)',
  `distracted_driving` int(11) DEFAULT '0' COMMENT '分神驾驶',
  `inconformity_certificate` int(11) DEFAULT '0' COMMENT '(风险事件人证不符)',
  `no_driver_detected` int(11) DEFAULT '0' COMMENT '(风险事件未检测到驾驶员)',
  `driver_exception` int(11) DEFAULT NULL,
  `keep_out` int(11) DEFAULT '0' COMMENT '(风险事件遮挡)',
  `infrared_blocking` int(11) DEFAULT '0' COMMENT '(风险事件红外阻断)',
  `fatigue_driving` int(11) DEFAULT '0' COMMENT '疲劳驾驶',
  `driver_behavior_monitor_failure` int(11) DEFAULT '0' COMMENT '驾驶员行为监测功能失效',
  `off_wheel` int(11) DEFAULT '0' COMMENT '双手同时脱离方向盘',
  `not_wearing_seat_belt` int(11) DEFAULT '0' COMMENT '未系安全带报警',
  `assist_failure` int(11) DEFAULT '0' COMMENT '驾驶辅助功能失效',
  `idle_speed` int(11) DEFAULT '0' COMMENT '怠速',
  `abnormal_flame_out` int(11) DEFAULT '0' COMMENT '异常熄火',
  `neutral_taxiing` int(11) DEFAULT '0' COMMENT '空挡滑行',
  `engine_overdrive` int(255) DEFAULT '0' COMMENT '发动机超转',
  `quick_crossing` int(11) DEFAULT '0' COMMENT '路口快速通过',
  `high_tire_pressure` int(11) DEFAULT '0' COMMENT '胎压过高',
  `low_tire_pressure` int(11) DEFAULT '0' COMMENT '胎压过低',
  `high_tire_temperature` int(11) DEFAULT '0' COMMENT '胎温过高',
  `sensor_anomaly` int(11) DEFAULT '0' COMMENT '传感器异常',
  `imbalance_tire_pressure` int(11) DEFAULT '0' COMMENT '胎压不平衡',
  `slow_leak` int(11) DEFAULT '0' COMMENT '慢漏气',
  `low_battery` int(11) DEFAULT '0' COMMENT '电池电量低',
  `close_behind` int(11) DEFAULT '0' COMMENT '后方接近',
  `left_rear_approach` int(11) DEFAULT '0' COMMENT '左侧后方接近',
  `right_rear_approach` int(11) DEFAULT '0' COMMENT '右侧后方接近',
  `left_blind_alert` int(11) DEFAULT '0' COMMENT '左侧盲区预警',
  `right_blind_alert` int(11) DEFAULT '0' COMMENT '右侧盲区预警',
  PRIMARY KEY (`group_id`,`time`,`card_number_name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
#司机评分企业评分表
CREATE TABLE `zw_m_group_driver_score` (
  `group_id` varchar(255) NOT NULL COMMENT '企业id',
  `time` int(11) NOT NULL COMMENT '查询的时间（201909）',
  `total_driver` int(255) DEFAULT NULL COMMENT '司机总数',
  `score` double(255,2) DEFAULT NULL COMMENT '企业综合得分',
  `score_ring_ratio` double(255,2) DEFAULT NULL COMMENT '得分环比',
  `bad_behavior` int(255) DEFAULT NULL COMMENT '不良行为次数',
  `bad_behavior_ring_ratio` double(255,2) DEFAULT NULL COMMENT '不良行为环比',
  `max_score_range` varchar(255) DEFAULT NULL,
  `day_of_driver_time` VARCHAR(20) DEFAULT NULL COMMENT '日均行驶时长',
  `hundred_mile_bad_behavior` double(255,2) DEFAULT NULL COMMENT '百公里不良行为次数',
  `hundred_mile_bad_behavior_ring_ratio` double(255,2) DEFAULT NULL COMMENT '百公里不良行为次数环比',
  `average_speed` double(255,2) DEFAULT NULL COMMENT '平均速度',
  `lucidity` double(255,2) DEFAULT NULL COMMENT '清醒度',
  `vigilance` double(255,2) DEFAULT NULL COMMENT '警惕性',
  `focus` double(255,2) DEFAULT NULL COMMENT '专注度',
  `consciousness` double(255,2) DEFAULT NULL COMMENT '自觉性',
  `stationarity` double(255,2) DEFAULT NULL COMMENT '平稳性',
  PRIMARY KEY (`group_id`,`time`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#司机评分列表和弹出框的表
CREATE TABLE `zw_m_group_driver_score_list` (
  `group_id` varchar(255) NOT NULL,
  `time` int(11) NOT NULL COMMENT '从业资格证号拼接字符串（84003529463400352907_璐璐12,84003529463400352906_璐璐1,84003529463400352915_璐璐12345678910,84003529463400352916_璐璐1234567891011,84003529463400352913_璐璐12345678,38032219960925310111_王老五,14003529463400352903_艾丽11）',
  `card_number_name` varchar(255) NOT NULL,
  `travel_mile` double(255,2) DEFAULT NULL COMMENT '行驶里程',
  `travel_times` int(11) DEFAULT NULL COMMENT '行驶次数',
  `average_travel_time` VARCHAR(20) DEFAULT NULL COMMENT '平均行驶时长',
  `average_speed` double DEFAULT NULL COMMENT '平均速度',
  `alarm` int(255) DEFAULT NULL COMMENT '报警数',
  `score` double(255,2) DEFAULT NULL COMMENT '综合得分',
  `score_ring_ratio` double(255,2) DEFAULT NULL COMMENT '综合得分环比',
  `bad_behavior` int(11) DEFAULT NULL COMMENT '不良行为次数',
  `bad_behavior_ring_ratio` double(255,2) DEFAULT NULL COMMENT '不良行为环比',
  `hundred_mile_bad_behavior` double(255,2) DEFAULT NULL COMMENT '百公里不良行为次数',
  `hundred_mile_bad_behavior_ring_ratio` double(255,2) DEFAULT NULL COMMENT '百公里不良行为次数环比',
  `day_of_driver_time` varchar(20) DEFAULT NULL COMMENT '日均行驶时长',
  `lucidity` double(255,2) DEFAULT NULL COMMENT '清醒度',
  `vigilance` double(255,2) DEFAULT NULL COMMENT '警惕性',
  `focus` double DEFAULT NULL COMMENT '专注度',
  `consciousness` double(255,2) DEFAULT NULL COMMENT '自觉性',
  `stationarity` double(255,2) DEFAULT NULL COMMENT '平稳性',
  `event_infos` text COMMENT '各个事件类型值json字符串',
  `score_range` tinyint(255) DEFAULT NULL COMMENT '(0代表0-20 2地表21-40 4代表41-60 6代表61-80 8代表81-100)',
  PRIMARY KEY (`group_id`,`time`,`card_number_name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `zw_m_upgrade_file_manager`;
CREATE TABLE `zw_m_upgrade_file_manager` (
  `id` varchar(64) NOT NULL DEFAULT '' COMMENT '文件升级管理表',
  `upload_time` datetime DEFAULT NULL COMMENT '上传时间',
  `upgrade_type` varchar(50) DEFAULT NULL COMMENT '升级类型',
  `file_name` varchar(255) DEFAULT NULL COMMENT '文件名称',
  `url` varchar(255) DEFAULT NULL COMMENT 'fastdfs路径',
  `manufacturer_id` varchar(255) DEFAULT NULL COMMENT '制造商id',
  `protocol_type` int(11) DEFAULT NULL COMMENT '协议',
  `equipment_model` varchar(255) DEFAULT NULL COMMENT '设备型号',
  `factory_number` varchar(255) DEFAULT NULL COMMENT '厂家编号',
  `depend_soft_version` varchar(255) DEFAULT NULL COMMENT '依赖版本编号',
  `soft_version` varchar(255) DEFAULT NULL COMMENT '软件版本',
  `flag` tinyint(4) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `zw_m_vehicle_upgrade`;
CREATE TABLE `zw_m_vehicle_upgrade` (
  `id` varchar(45) NOT NULL,
  `cron_expression` varchar(255) DEFAULT NULL COMMENT 'cron表达式',
  `method_name` varchar(255) DEFAULT NULL COMMENT '任务调用的方法名',
  `is_concurrent` tinyint(255) DEFAULT NULL COMMENT '任务是否有状态',
  `description` varchar(255) DEFAULT NULL COMMENT '任务描述',
  `bean_class` varchar(255) DEFAULT NULL COMMENT '任务执行时调用哪个类的方法 包名+类名',
  `job_status` tinyint(255) DEFAULT NULL COMMENT '任务状态',
  `job_group` varchar(255) DEFAULT NULL COMMENT '任务分组',
  `spring_bean` varchar(255) DEFAULT NULL COMMENT 'Spring bean',
  `job_name` varchar(255) DEFAULT NULL COMMENT '任务名',
  `create_data_time` datetime DEFAULT NULL,
  `create_data_username` varchar(64) DEFAULT NULL,
  `update_data_time` datetime DEFAULT NULL,
  `update_data_username` varchar(64) DEFAULT NULL,
  `flag` smallint(6) NOT NULL DEFAULT '1',
  `vehicle_id` varchar(64) DEFAULT NULL,
  `schedule_upgrade_time` datetime DEFAULT NULL,
  `upgrade_strategy_flag` tinyint(4) DEFAULT NULL,
  `batch_upgrade_num` int(11) DEFAULT NULL,
  `file_id` varchar(64) DEFAULT NULL,
  `upgrade_type` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

